import datetime

def unfilled_employee_data(employee_table):

    def is_valid_date(date_str):
        try:
            datetime.datetime.strptime(date_str, '%Y-%m-%d')
            return True
        except ValueError:
            return False

    def is_valid_age(age):
        return 0 <= age <= 100
    return [employee for employee in employee_table if (not employee.get('role') or not employee.get('department')) and is_valid_date(employee.get('dob', '')) and is_valid_age(employee.get('age', 0))]

